import './App.css';
import CreateCredentialForm from './components/CreateCredentialForm';
import CredentialList from './components/CredentialList';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Create a Microcredential</h1>
      </header>
      <CreateCredentialForm />
    </div>
  );
}

export default App;
